import React from 'react';
import "./SignUpPage.css";

const SignUpPage = () => {
  return (
    <div className="signuppage">
      <div className="div53">회원가입</div>
      <div className="div54">{`운동뭉치의 다양한 서비스를 경험해보세요 `}</div>
      <input type="text" className="div55" placeholder="이름" />
      <input type="password" className="div56" placeholder="비밀번호" />
      <input type="password" className="div57" placeholder="비밀번호 확인" />
      <input type="text" className="div58" placeholder="닉네임" />
      <input type="text" className="div59" placeholder="아이디" />
      <input type="button" className="div60" value="중복확인" />
      <input type="text" className="div61" placeholder="******" />
      <input type="text" className="div62" placeholder="******" />
      <div className="div63">{`간편 회원가입 `}</div>
      <div className="signuppage-child6" />
      <img className="kakao-login-1-icon1" alt="" src="/kakao-login-1@2x.png" />
      <input type="button" className="div64" value="가입하기" />
    </div>
  );
};

export default SignUpPage;
